import React from 'react'
import {Box} from'@mui/material';
const HorizontalScrollBar = ({data}) => {
  return (
    <div>
        hi
        {data.map((item)=>(
            <Box 
            key={item.id || item}
            itemId={item.id||item}
            title={item.id||item}
            m="0 40px">
              {item}
            </Box>
        ))}
    </div>
  )
}

export default HorizontalScrollBar
